import styled from "styled-components";
import GetPokemonData from "../Utils/GetPokemonData"
import { Row, Col } from 'antd';

const GridWrapper = styled.div`
    display: flex;
    align-items: center;
    justify-content: center;
    `;





export default function ola() {
    return (
        <GridWrapper>
            <Container>
  <Row>
    <Col>1 of 2</Col>
    <Col>2 of 2</Col>
  </Row>
  </Container>
        </GridWrapper>
    )
}
